import React, { Component } from 'react';
import './Exportar.css';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';


class Exportar extends Component {

    render() {

        return (

            <div id="index-modulos" className="row">
                <div className="col l12">
                    <div className="card-panel">
                        <div className="card-content">
                            <button className="btn waves-effect waves-light col l12" type="button" onClick={this.login} name="action">Exportar</button>
                        </div>
                    </div>
                </div>

            </div>


        );
    }
}

const mapToStateProps = (reducers) => {
    return reducers.modulosReducers;
}
export default connect(mapToStateProps, modulosActions)(Exportar);
